import React, { useState, useEffect } from 'react'
import { useSelector, useDispatch } from "react-redux";
import CrudFormProduct from './CrudFormProduct'
import CrudTableProduct from './CrudTableProduct'
import Loader from './Loader'
import Message from './Message'
import { helpFetch } from '../../helpers/helpFetch'
import { noAction, readAllAction } from '../../actions/productsActions';
import Product from '../Product';

const CrudApiProducto = () => {

  const state = useSelector(state => state)
  const dispatch = useDispatch();

  const {db} = state.product

  const api = helpFetch()
  
  useEffect(() => {
    api.get("products").then((res) => {
      if (!res.error) {
          dispatch(readAllAction(res))
          console.log(res);
      } else {
          dispatch(noAction())
      }
    })
  }, ["products",dispatch])

  return (
    <div>
        <h2>PRUEBA</h2>
        <article className="box grid-responsive">
        {db.map((product) => <Product key={product.id} data={product} />)}
        </article>
    </div>
  )
}

export default CrudApiProducto
